import React from "react";
import { Text, View } from 'react-native';

function JobBoard() {
  return (
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text>here are some new jobs you can do!</Text>
        </View>
  );
}
export default JobBoard;
